import React, { Component } from "react";
import Resume from "./components/Resume";
import Form from "./components/Form";
import Card from "./components/Card";
import "../src/styles/App.css";

class App extends Component {
  state = {
    footerArray: [],
    videoInfo: [],
    commentArray: [],

    arr: []
  };

  render() {
    return (
      <>
        <Resume />
        <Form />

        <Card />
      </>
    );
  }
}
export default App;
